 ('70', '70', 'en_us', 'Hero Welcome', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-08-28 12:01:26', '2017-08-28 20:46:40', '2f00c4c5-7556-4cad-8015-68797c7d07e9'),
